import React from 'react';
import './BarPlot.css';

function BarPlot({ imageUrl }) {
  return (
    <div className="bar-plot-container">
      <h3>Bar Plot</h3>
      <img src={imageUrl} alt="Bar Plot" className="bar-plot-image" />
    </div>
  );
}

export default BarPlot;
